import React from 'react';

const ArrivalChecklist = () => {
  const arrivalTasks = [
    {
      icon: 'üìù',
      title: 'Apply for SIN',
      desc: 'Social Insurance Number for work and tax',
    },
    {
      icon: 'üè¶',
      title: 'Open a Bank Account',
      desc: 'Canadian account for salary, rent, and bills',
    },
    {
      icon: 'üì±',
      title: 'Get a SIM Card',
      desc: 'Local number for calls and data',
    },
    {
      icon: 'üí≥',
      title: 'Build Credit History',
      desc: 'Apply for a credit card to start your credit journey',
    },
    {
      icon: 'ü©∫',
      title: 'Apply for Health Card',
      desc: 'Register for MSP (BC) or OHIP (Ontario)',
    },
    {
      icon: 'üöå',
      title: 'Public Transit Info',
      desc: 'Get Compass/Presto cards and learn routes',
    },
    {
      icon: 'üè†',
      title: 'Find Housing',
      desc: 'Browse rentals and connect with roommates',
    },
    {
      icon: 'üìö',
      title: 'Newcomer Orientation',
      desc: 'Register for city or college orientation sessions',
    },
  ];

  return (
    <div className="p-6 bg-white rounded-lg shadow">
      <h2 className="text-xl font-semibold mb-4">üéØ Things to Do When You Arrive in Canada</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
        {arrivalTasks.map((task, index) => (
          <div
            key={index}
            className="border rounded-lg p-4 bg-gray-50 hover:shadow transition-all"
          >
            <div className="text-3xl mb-2">{task.icon}</div>
            <h3 className="font-bold">{task.title}</h3>
            <p className="text-sm text-gray-600">{task.desc}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ArrivalChecklist;
